function updateProgress(n,t,i){if(n<=t){percents=parseInt(n/(t/100));var r=document.getElementById("loadingStatus");r.style.width=percents+"%";$("#loadingStatus").text(percents+"% completed");$("#analyzerLog").append(i)}}$(document).ready(function(){var t=0,n="";$.ajax({type:"POST",url:"/Home/GetSourcesStatistics",contentType:"application/json; charset=utf-8",data:"{}",dataType:"json",async:!1,success:function(i){$.each(i,function(r,u){$("#analyzerLog").hide();n+="<p>"+u+"<\/p>";setTimeout(updateProgress,1,++t,i.length,n);n=""});$("#analyzerLog").show()},error:function(n){return $("#message").html("<strong>Can't analyze source code<\/strong>.<br/>"+n.responseText),!1}});$("#detailedReportForm").submit(function(){$("#btnGetDetailedReport").empty();$("#btnGetDetailedReport").append('<i class="spinner-border spinner-border-sm"><\/i> Creating report');$("#btnGetDetailedReport").prop("disabled",!0)})});